	public static boolean GenerateImage1(byte[] b, String photoname, String imagePath) {

		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64解码
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {
					// 调整异常数据
					b[i] += 256;
				}
			}
			// System.currentTimeMillis()
			// 新生成的图片
			String imgFilePath = imagePath + photoname;
			OutputStream out = new FileOutputStream(imgFilePath);
			out.write(b);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}

