	public static boolean GenerateImage(String imgStr, String photoname, String imagePath) {
		// 对字节数组字符串进行Base64解码并生成图片
		// 图像数据为空
		if (imgStr == null)
			return false;

		BASE64Decoder decoder = new BASE64Decoder();
		try {
			// Base64解码
			byte[] b = decoder.decodeBuffer(imgStr);
			for (int i = 0; i < b.length; ++i) {
				if (b[i] < 0) {
					// 调整异常数据
					b[i] += 256;
				}
			}
			// System.currentTimeMillis()
			// 新生成的图片
			String imgFilePath = imagePath + photoname;
			OutputStream out = new FileOutputStream(imgFilePath);
			out.write(b);
			out.flush();
			out.close();
			return true;
		} catch (Exception e) {
			return false;
		}
	}

	private static Image[] subImages(byte[] sealImg, int number, float first, String direction)
			throws IOException, BadElementException {
		Image[] nImage = new Image[number];
		ByteArrayOutputStream out = new ByteArrayOutputStream();
		BufferedImage img = ImageIO.read(new ByteArrayInputStream(sealImg));
		int h = img.getHeight();
		int w = img.getWidth();

		if (number == 1) {
			Image temp = Image.getInstance(sealImg);
			nImage[0] = temp;
			return nImage;
		}

		if (direction != null && direction.trim().equals("L")) { // 左骑缝模式
			// 生成第一个切图
			int firstSw = (int) (w * first / 100f);
			BufferedImage fImg = img.getSubimage(w - firstSw, 0, firstSw, h);
			ImageIO.write(fImg, "png", out);
			nImage[0] = Image.getInstance(out.toByteArray());
			out.flush();
			out.reset();

			// 生成剩余部分切图
			int sw = (w - firstSw) / (number - 1);
			for (int i = 1; i < number; i++) {
				BufferedImage subImg;
				if (i == number - 1) {// 最后剩余部分
					subImg = img.getSubimage(0, 0, sw, h);
				} else {// 前n-1块均匀切
					subImg = img.getSubimage(w - firstSw - i * sw, 0, sw, h);
				}

				ImageIO.write(subImg, "png", out);
				nImage[i] = Image.getInstance(out.toByteArray());
				out.flush();
				out.reset();
			}
		} else { // 右骑缝模式

			// 生成第一个切图
			int firstSw = (int) (w * first / 100f);
			BufferedImage fImg = img.getSubimage(0, 0, firstSw, h);
			ImageIO.write(fImg, "png", out);
			nImage[0] = Image.getInstance(out.toByteArray());
			out.flush();
			out.reset();

			// 生成剩余部分切图
			int sw = (w - firstSw) / (number - 1);
			for (int i = 1; i < number; i++) {
				BufferedImage subImg;
				if (i == number - 1) {// 最后剩余部分
					subImg = img.getSubimage((i - 1) * sw + firstSw, 0, w - firstSw - (i - 1) * sw, h);
				} else {// 前n-1块均匀切
					subImg = img.getSubimage((i - 1) * sw + firstSw, 0, sw, h);
				}

				ImageIO.write(subImg, "png", out);
				OutputStream out1 = new FileOutputStream("D://123.png");
				out1.write(out.toByteArray());
				out1.flush();
				out1.close();
				nImage[i] = Image.getInstance(out.toByteArray());
				out.flush();
				out.reset();
			}
		}
		return nImage;
	}

